import { makeStyles } from "@mui/styles"

const homeStyles = makeStyles (() =>({
    card:{
        maxWidth: 340,
        color: '#ffffff',
        borderRadius:'12%',
        borderColor: 'red',
        border: 2,
    },
    title:{
        marginLeft: '25px',
    },
    }
))

export default homeStyles
